import "./style.css";
import logo from "../../assets/logo-land.svg";
import img from "../../assets/illustration.svg";
export const LandPage = () => {
  return (
    <section className="land__container">
      <div className="land">
        <div className="land-text__container">
          <img src={logo} alt="" />
          <h2>Centralize o controle das suas finanças</h2>
          <p>de forma rápida e segura</p>
          <button className="button-default">Iniciar</button>
          <div className="land-img__container"></div>
        </div>
        <div>
          <img src={img} alt="" />
        </div>
      </div>
    </section>
  );
};
